import React from 'react';

const Listing = (props) => {
  const {
    available, 
    city, 
    condition, 
    list_id, 
    list_name, 
    price, 
    seller
  } = props;
  
  return (
    <section
      style={{
        width: '600px',
        padding: '20px',
        display: 'flex',
        flexWrap: 'wrap'
      }}
    >
      
      
    </section>
  )
};

export default Listing;
